/*Table structure for table `community` */

DROP TABLE IF EXISTS `community`;

CREATE TABLE `community` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) DEFAULT NULL COMMENT '名称',
  `province_id` bigint(20) DEFAULT NULL COMMENT '省份',
  `city_id` bigint(20) DEFAULT NULL COMMENT '城市',
  `district_id` bigint(20) DEFAULT NULL COMMENT '地区',
  `telephone` varchar(11) DEFAULT NULL COMMENT '物业电话',
  `mobilephone` varchar(18) DEFAULT NULL COMMENT '物业手机',
  `contacter` varchar(10) DEFAULT NULL COMMENT '联系人',
  `address` varchar(20) DEFAULT NULL COMMENT '地址',
  `longitude` double DEFAULT NULL COMMENT '经度',
  `latitude` double DEFAULT NULL COMMENT '纬度',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

