  `article_id` bigint(20) DEFAULT NULL COMMENT '文章',
  `store_id` bigint(20) DEFAULT NULL COMMENT '商家',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

