/*Table structure for table `systemmessage` */

DROP TABLE IF EXISTS `systemmessage`;

CREATE TABLE `systemmessage` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `community_id` bigint(20) DEFAULT NULL COMMENT '小区',
  `content` text COMMENT '内容',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `pushTime` datetime DEFAULT NULL COMMENT '推送时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

/*Data for the table `systemmessage` */

insert  into `systemmessage`(`id`,`title`,`community_id`,`content`,`createTime`,`pushTime`) values (3,'E家1.0版本上线啦！',NULL,'欢迎大家下载及使用，谢谢！\r\n',NULL,NULL),(4,'E家下载地址',NULL,'<a href=\"http://www.baidu.com\">点此下载</a>',NULL,NULL),(5,'人是铁饭是钢',NULL,'一顿不吃饿得荒','2014-08-02 20:18:40','2014-08-02 20:19:50');

/*Table structure for table `topic` */

DROP TABLE IF EXISTS `topic`;

CREATE TABLE `topic` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `community_id` bigint(20) DEFAULT NULL COMMENT '小区',
  `title` varchar(500) DEFAULT NULL COMMENT '标题',
  `content` text COMMENT '内容',
  `createTime` datetime DEFAULT NULL COMMENT '发表时间',
  `lastReplyTime` datetime DEFAULT NULL COMMENT '最后回复时间',
  `clickCount` int(11) DEFAULT '0' COMMENT '点击次数',
  `replyCount` int(11) DEFAULT '0' COMMENT '回复次数',
  `user_id` bigint(20) DEFAULT NULL COMMENT '发起人',
  `isInviteEstate` tinyint(4) DEFAULT '0' COMMENT '是否邀请物业回复',
  `isEstateReplied` tinyint(4) DEFAULT '0' COMMENT '物业是否已经回复',
  `image` varchar(1024) DEFAULT NULL COMMENT '图片列表',
  `currentFloor` int(11) DEFAULT NULL COMMENT '当前是第几楼',
  PRIMARY KEY (`id`)
