/*Table structure for table `topicreply` */

DROP TABLE IF EXISTS `topicreply`;

CREATE TABLE `topicreply` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `topic_id` bigint(20) DEFAULT NULL COMMENT '帖子',
  `content` text COMMENT '回复内容',
  `user_id` bigint(20) DEFAULT NULL COMMENT '回复用户',
  `replyTime` datetime DEFAULT NULL COMMENT '回复时间',
  `isestate` tinyint(4) DEFAULT NULL COMMENT '是否是物业回复',
  `parent_reply_id` bigint(20) DEFAULT NULL COMMENT '引用回复',
  `floor` int(11) DEFAULT '1' COMMENT '第几楼',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

